import React from "react";

export default function Table() {
  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th>SELECT</th>
            <th className="text-left">PLAYER NAME</th>
            <th>LEVEL</th>
            <th>AVATAR</th>
            <th>
              {" "}
              <img
                src={require("../assets/images/poker-chip.png")}
                alt=""
                height="12"
                width="12"
              />{" "}
              BET
            </th>
            <th>
              <img
                src={require("../assets/images/trophy.png")}
                alt=""
                height="12"
                width="12"
              />{" "}
              WINS
            </th>
            <th>LOST</th>
            <th>
              <img
                src={require("../assets/images/coin.png")}
                alt=""
                height="12"
                width="12"
              />{" "}
              PRICE
            </th>
          </tr>
        </thead>
        <tbody>
          {[1, 2, 4, 5, 3].map((item) => {
            return (
              <tr>
                <td className="text-center">box</td>
                <td className="text-left">Disha</td>
                <td className="text-center">2</td>
                <td className="text-center">
                  {" "}
                  <img
                    src={require("../assets/images/coin.png")}
                    alt=""
                    height="12"
                    width="12"
                  />
                </td>
                <td className="text-center">5</td>
                <td className="text-center">20</td>
                <td className="text-center">2</td>
                <td className="text-center">892</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
